		{
			"_addr": "0x9ec26770",
			"current_frame": "normal",
			"custom": "yes",
			"face_right": 1,
			"label": "how_to_walljump",
			"on_talk": "speech_dialog(	null,			[~Some changes in elevation are too high
to clear with just a normal jump.~],
											[~Fortunately, Frogatto can jump off of walls, too!~],
											[~To do this, do a walking jump into the wall.~],
											[~If you bump into a wall at the crest of a jump,
you will cling to the wall and slowly slide down.~],
											[~If you don't get a running start, you can still
cling on, if you tap the arrow toward the wall,
and press jump whilst it's held down.~],
											[~Whilst you are clinging to the wall,
pressing jump will make you rebound off.~],
											[~This is especially useful, if two walls are
facing each other, because then you can
rebound over and over between them.~],
											[~This lets you ascend vertical columns.~])",
			"time_in_frame": 0,
			"type": "help_npc",
			"vars": {
				"turn_to_face_player": 0
			},
			"velocity_x": 0,
			"velocity_y": 0,
			"x": -896,
			"y": 416
		},
		{
			"_addr": "0x9ee0e6e8",
			"current_frame": "normal",
			"custom": "yes",
			"face_right": 1,
			"label": "how_to_fight",
			"on_talk": "speech_dialog(	null,			[~Frogatto's world is a dangerous place.~],
											[~In his travels, you'll encounter
many creatures who want to hurt you.~],
											[~It's often fine to just avoid them, but if you have
to fight, Frogatto's best defense is his tongue.~],
											[~You can grab enemies with the tongue,
and then spit them back out.~],
											[~Once spat out, they become a deadly projectile.~],
											[~If they don't hit anything, they'll be stunned
momentarily, and then will flip upright again.~],
											[~Whilst on their backs,
they're vulnerable to being stomped on.~],
											[~Sticking out the tongue and spitting,
are both done with the attack key.~],
											[~There are a few ants just ahead.
Feel free to try this on them.~],
											[~And don't worry - if you die,
you'll restart right here.~])",
			"time_in_frame": 0,
			"type": "help_npc",
